 \u0432\u0441\u0451 \u043f\u043e\u0440\u0442\u043e\u0432\u043e\u0435 \u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u043e. \u041f\u0435\u0440\u0432\u044b\u043c \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u043c \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u043e\u043c \u0432\u043e\u0434\u043d\u043e\u0433\u043e \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u0430 \u043d\u0430\u0437\u043d\u0430\u0447\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BD%D1%81%D0%BE%D0%BD,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u042f\u043d\u0441\u043e\u043d, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u041d.&#160;\u041c.&#160;\u042f\u043d\u0441\u043e\u043d<\/a>, \u0447\u043b\u0435\u043d \u043f\u0430\u0440\u0442\u0438\u0438 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905 \u0433\u043e\u0434\u0430<\/a>, \u0440\u0430\u0431\u043e\u0442\u043d\u0438\u043a \u0426\u041a \u0412\u041a\u041f(\u0431) \u0432 \u043f\u0440\u043e\u0448\u043b\u043e\u043c \u043c\u043e\u0440\u044f\u043a \u0442\u043e\u0440\u0433\u043e\u0432\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430&#160;\u2014 \u043f\u043b\u0430\u0432\u0430\u043b \u043a\u043e\u0447\u0435\u0433\u0430\u0440\u043e\u043c \u043d\u0430 \u0441\u0443\u0434\u0430\u0445, \u0440\u0430\u0431\u043e\u0442\u0430\u043b \u0432 \u043f\u043e\u0440\u0442\u043e\u0432\u044b\u0445 \u043c\u0430\u0441\u0442\u0435\u0440\u0441\u043a\u0438\u0445 \u0438 \u043d\u0430 \u0441\u0443\u0434\u043e\u0440\u0435\u043c\u043e\u043d\u0442\u043d\u044b\u0445 \u0437\u0430\u0432\u043e\u0434\u0430\u0445 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933\" class=\"mw-redirect\" title=\"1933\">1933<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D1%85%D1%81%D0%BF%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82\" title=\"\u0420\u0435\u0439\u0445\u0441\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\">\u0420\u0435\u0439\u0445\u0441\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442<\/a> \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%BD%D0%B4%D0%B5%D0%BD%D0%B1%D1%83%D1%80%D0%B3,_%D0%9F%D0%B0%D1%83%D0%BB%D1%8C_%D1%84%D0%BE%D0%BD\" title=\"\u0413\u0438\u043d\u0434\u0435\u043d\u0431\u0443\u0440\u0433, \u041f\u0430\u0443\u043b\u044c \u0444\u043e\u043d\">\u0413\u0438\u043d\u0434\u0435\u043d\u0431\u0443\u0440\u0433<\/a> \u043d\u0430\u0437\u043d\u0430\u0447\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D1%82%D0%BB%D0%B5%D1%80,_%D0%90%D0%B4%D0%BE%D0%BB%D1%8C%D1%84\" title=\"\u0413\u0438\u0442\u043b\u0435\u0440, \u0410\u0434\u043e\u043b\u044c\u0444\">\u0410\u0434\u043e\u043b\u044c\u0444\u0430 \u0413\u0438\u0442\u043b\u0435\u0440\u0430<\/a> \u043a\u0430\u043d\u0446\u043b\u0435\u0440\u043e\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934_%D0%B3%D0%BE%D0%B4\" title=\"1934 \u0433\u043e\u0434\">1934<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D1%80%D0%B0%D1%82%D0%BE%D1%81%D1%82%D0%B0%D1%82\" title=\"\u0421\u0442\u0440\u0430\u0442\u043e\u0441\u0442\u0430\u0442\">\u0441\u0442\u0440\u0430\u0442\u043e\u0441\u0442\u0430\u0442<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%BE%D0%B0%D0%B2%D0%B8%D0%B0%D1%85%D0%B8%D0%BC-1\" title=\"\u041e\u0441\u043e\u0430\u0432\u0438\u0430\u0445\u0438\u043c-1\">\u041e\u0441\u043e\u0430\u0432\u0438\u0430\u0445\u0438\u043c-1<\/a>\u00bb \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u043c\u0438\u0440\u0435 \u0434\u043e\u0441\u0442\u0438\u0433 \u0432\u044b\u0441\u043e\u0442\u044b 22&#160;\u043a\u043c. \u041f\u0440\u0438 \u0441\u043f\u0443\u0441\u043a\u0435 \u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0443 \u0438 \u0432\u0441\u0435 \u0442\u0440